// Likes.jsx
import React from 'react';

const Likes = ({ likeList }) => {
  return (
      <div className="likes">
          {likeList.map(like => (
              <div key={like.id} className="like-item">
                  {like.content}
              </div>
          ))}
      </div>
  );
};

export default Likes;
